import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Sidebar from '../components/Sidebar';
import api from '../services/api';
import './Dashboard.css';

const AgentDashboard = () => {
    const [user, setUser] = useState(null);
    const [assignedComplaints, setAssignedComplaints] = useState([]);
    const [resolvedComplaints, setResolvedComplaints] = useState([]);
    const [allComplaints, setAllComplaints] = useState([]);
    const [activeTab, setActiveTab] = useState('assigned');
    const [loading, setLoading] = useState(true);
    const navigate = useNavigate();

    useEffect(() => {
        const userData = localStorage.getItem('user');
        if (!userData) {
            navigate('/login');
            return;
        }

        const parsedUser = JSON.parse(userData);
        if (parsedUser.role !== 'AGENT') {
            navigate('/login');
            return;
        }

        setUser(parsedUser);
        fetchAllData(parsedUser.userId);
    }, [navigate]);

    const fetchAllData = async (agentId) => {
        try {
            const [assignedResponse, resolvedResponse, allResponse] = await Promise.all([
                api.get(`/complaint/agent/${agentId}/assigned`),
                api.get(`/complaint/agent/${agentId}/resolved`),
                api.get(`/complaint/agent/${agentId}`)
            ]);
            setAssignedComplaints(assignedResponse.data);
            setResolvedComplaints(resolvedResponse.data);
            setAllComplaints(allResponse.data);
        } catch (error) {
            console.error('Error fetching complaints:', error);
        } finally {
            setLoading(false);
        }
    };

    const updateComplaintStatus = async (complaintId, status) => {
        try {
            await api.post('/complaint/update-status', {
                complaintId,
                status
            });
            fetchAllData(user.userId);
        } catch (error) {
            console.error('Error updating status:', error);
        }
    };

    const getStatusColor = (status) => {
        switch (status) {
            case 'Assigned': return '#ffc107';
            case 'In Progress': return '#17a2b8';
            case 'Resolved': return '#28a745';
            default: return '#6c757d';
        }
    };

    const renderComplaintTable = (complaints, showActions = true) => (
        <div className="complaints-table">
            <table>
                <thead>
                    <tr>
                        <th>Tracking ID</th>
                        <th>Customer</th>
                        <th>Type</th>
                        <th>Description</th>
                        <th>Status</th>
                        <th>Assigned Date</th>
                        {activeTab === 'resolved' && <th>Resolved Date</th>}
                        {showActions && <th>Actions</th>}
                    </tr>
                </thead>
                <tbody>
                    {complaints.map(complaint => (
                        <tr key={complaint.complaintId}>
                            <td>{complaint.trackingId}</td>
                            <td>{complaint.user.username}</td>
                            <td>{complaint.complaintType}</td>
                            <td className="description-cell">
                                {complaint.complaintDescription.substring(0, 50)}...
                            </td>
                            <td>
                                <span 
                                    className="status-badge"
                                    style={{ backgroundColor: getStatusColor(complaint.status) }}
                                >
                                    {complaint.status}
                                </span>
                            </td>
                            <td>{complaint.assignmentDate}</td>
                            {activeTab === 'resolved' && <td>{complaint.resolvedDate}</td>}
                            {showActions && (
                                <td>
                                    <div className="action-buttons">
                                        {complaint.status === 'Assigned' && (
                                            <button 
                                                className="btn btn-primary"
                                                onClick={() => updateComplaintStatus(complaint.complaintId, 'In Progress')}
                                            >
                                                Start Work
                                            </button>
                                        )}
                                        {complaint.status === 'In Progress' && (
                                            <button 
                                                className="btn btn-success"
                                                onClick={() => updateComplaintStatus(complaint.complaintId, 'Resolved')}
                                            >
                                                Mark Resolved
                                            </button>
                                        )}
                                        <button 
                                            className="btn btn-info"
                                            onClick={() => navigate(`/complaint-details/${complaint.complaintId}`)}
                                        >
                                            View Details
                                        </button>
                                    </div>
                                </td>
                            )}
                        </tr>
                    ))}
                </tbody>
            </table>
            {complaints.length === 0 && (
                <div className="no-data">
                    {activeTab === 'assigned' && 'No assigned complaints.'}
                    {activeTab === 'resolved' && 'No resolved complaints yet.'}
                    {activeTab === 'history' && 'No complaint history available.'}
                </div>
            )}
        </div>
    );

    if (loading) return <div className="loading">Loading...</div>;

    return (
        <div className="dashboard-container">
            <Sidebar userRole="AGENT" />
            <div className="main-content">
                <div className="dashboard-header">
                    <h1>Agent Dashboard</h1>
                    <p>Welcome back, {user?.username}!</p>
                    <p>Specialization: <strong>{user?.agentSpecialization}</strong></p>
                </div>

                <div className="stats-grid">
                    <div className="stat-card">
                        <h3>Assigned Complaints</h3>
                        <div className="stat-number">{assignedComplaints.length}</div>
                    </div>
                    <div className="stat-card">
                        <h3>In Progress</h3>
                        <div className="stat-number">
                            {assignedComplaints.filter(c => c.status === 'In Progress').length}
                        </div>
                    </div>
                    <div className="stat-card">
                        <h3>Resolved Complaints</h3>
                        <div className="stat-number">{resolvedComplaints.length}</div>
                    </div>
                    <div className="stat-card">
                        <h3>Total Handled</h3>
                        <div className="stat-number">{allComplaints.length}</div>
                    </div>
                </div>

                <div className="complaints-section">
                    <div className="tab-navigation">
                        <button 
                            className={`tab-button ${activeTab === 'assigned' ? 'active' : ''}`}
                            onClick={() => setActiveTab('assigned')}
                        >
                            Assigned Complaints ({assignedComplaints.length})
                        </button>
                        <button 
                            className={`tab-button ${activeTab === 'resolved' ? 'active' : ''}`}
                            onClick={() => setActiveTab('resolved')}
                        >
                            Resolved Complaints ({resolvedComplaints.length})
                        </button>
                        <button 
                            className={`tab-button ${activeTab === 'history' ? 'active' : ''}`}
                            onClick={() => setActiveTab('history')}
                        >
                            Complete History ({allComplaints.length})
                        </button>
                    </div>

                    <div className="tab-content">
                        {activeTab === 'assigned' && (
                            <div>
                                <h2>My Assigned Complaints</h2>
                                {renderComplaintTable(assignedComplaints, true)}
                            </div>
                        )}
                        {activeTab === 'resolved' && (
                            <div>
                                <h2>My Resolved Complaints</h2>
                                {renderComplaintTable(resolvedComplaints, false)}
                            </div>
                        )}
                        {activeTab === 'history' && (
                            <div>
                                <h2>Complete Complaint History</h2>
                                {renderComplaintTable(allComplaints, false)}
                            </div>
                        )}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AgentDashboard;
